  false,\n\t\"url\": null,\n\t\"notes\": \"Provides aggregate revenue data for Board
  of Regent's universities and special schools by fiscal year, class and unit starting
  with Fiscal Year 2012.  Fiscal years run from July 1 to the following June 30, and
  are numbered for the calendar year in which they end.  All receipts are deposited
  to the appropriate fiscal year in which the revenues were received.  If revenue
  is received after the end of the fiscal year but within 60 days, they may be adjusted
  back to previous fiscal year.  If received after 60 days, they are recorded in the
  fiscal year received.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
